import React, {Component} from 'react';
import './App.css';

class form extends Component {
  constructor(props) {
    super();
    this.heading = props.heading;
  }

render() {
  return (
    <form id="survey-form">
          <h2 c> {this.heading} </h2>

        <input name="user-recommend" type="radio" class="input-radio"/>

         <button>
          Submit
        </button>

     </form>
);
}
}

export default form;
